import React from 'react';
import cat from './cat.jpg';


class Home extends React.Component{
  
    render() {
      return(
        <div>
          <header >
            <img src={cat} />
            <p>
              Edit <code>src/App.js</code> and save to reload.
            </p>
            <a
              className="App-link"
              href="https://reactjs.org"
              target="_blank"
              rel="noopener noreferrer"
            >
              Learn React
            </a>
          </header>
        </div>
      );
    }
  }
  
  export default Home;
